          let newdate = ('0'+date.getDate()).slice(-2)+'.'+('0'+(date.getMonth()+1)).slice(-2)+'.'+date.getFullYear()
          return  newdate
        }else{
          return "-"
        }
      },
    dateFilter2(e){
        if(e){
          let date = new Date(Number(e))
          let newdate = ('0'+date.getDate()).slice(-2)+'.'+('0'+(date.getMonth()+1)).slice(-2)+'.'+date.getFullYear()
          return  newdate
        }else{
          return "-"
        }
      },
